import React, { Suspense } from 'react';
import './i18n';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <Suspense>
  <React.StrictMode>
    <App />
  </React.StrictMode>
  </Suspense>,

  document.getElementById('root')
);
